INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 37, 37, 450, 0, 0, "2021/10/19 12:00:00", 1, 2, 0, "2030/12/31 15:00:00", 787, 0, 118501, 0, 118501, 118501, 118501, 1, 0, 2.0, 0, "カリン", "かりん");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 0, 0, 450, 0, 0, "2024/08/10 21:00:00", 3, 2, 0, "2030/12/31 15:00:00", 826, 0, 118601, 0, 118601, 118601, 118601, 1, 0, 2.0, 0, "ネビア", "ねびあ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 7, 7, 450, 0, 0, "2021/11/03 19:00:00", 3, 2, 0, "2030/12/31 15:00:00", 714, 0, 119001, 0, 119001, 119001, 119001, 0, 15, 2.27, 0, "イオ（ノワール）", "いお");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 26, 7, 450, 0, 0, "2021/11/16 12:00:00", 3, 2, 0, "2030/12/31 15:00:00", 143, 0, 119101, 0, 119101, 119101, 119101, 0, 12, 2.545, 0, "クウカ（ノワール）", "くうか");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 6, 6, 450, 0, 0, "2023/09/19 15:00:00", 1, 1, 0, "2030/12/31 15:00:00", 397, 0, 119201, 0, 119201, 119201, 119201, 1, 5, 2.19, 0, "マヒル（クリスマス）", "まひる");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 8, 8, 450, 0, 0, "2021/12/22 12:00:00", 3, 1, 0, "2030/12/31 15:00:00", 762, 0, 119301, 0, 119301, 119301, 119301, 0, 6, 1.97, 0, "リノ（クリスマス）", "りの");
