INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 1, 1, 450, 0, 0, "2024/12/22 12:00:00", 3, 1, 0, "2024/12/31 11:59:59", 302, 0, 119901, 0, 119901, 119901, 119901, 1, 14, 2.17, 0, "ミヤコ（クリスマス）", "みやこ");
