INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 22, 4, 450, 0, 0, "2025/01/15 15:00:00", 3, 1, 0, "2025/01/20 11:59:59", 283, 0, 120701, 0, 120701, 120701, 120701, 1, 1, 1.84, 0, "シェフィ（ニューイヤー）", "しぇふぃ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 22, 4, 450, 0, 0, "2023/10/16 15:00:00", 1, 1, 0, "2030/12/31 15:00:00", 193, 0, 120801, 0, 120801, 120801, 120801, 1, 2, 1.3, 0, "ルカ（ニューイヤー）", "るか");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 38, 3, 450, 0, 0, "2025/01/15 15:00:00", 3, 2, 0, "2025/01/20 11:59:59", 424, 0, 120901, 0, 120901, 120901, 120901, 1, 12, 1.425, 0, "イリヤ（ニューイヤー）", "いりや");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 41, 5, 450, 0, 0, "2024/02/22 12:00:00", 3, 1, 0, "2024/02/29 11:59:59", 164, 0, 121001, 0, 121001, 121001, 121001, 1, 1, 2.25, 0, "ペコリーヌ（オーバーロード）", "ぺこりーぬ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 42, 7, 450, 0, 0, "2024/02/22 12:00:00", 3, 2, 0, "2024/02/29 11:59:59", 588, 0, 121101, 0, 121101, 121101, 121101, 1, 1, 2.07, 0, "キャル（オーバーロード）", "きゃる");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 40, 4, 450, 0, 0, "2023/11/16 15:00:00", 1, 1, 0, "2030/12/31 15:00:00", 260, 0, 121201, 0, 121201, 121201, 121201, 1, 6, 1.55, 0, "ラビリスタ（オーバーロード）", "らびりすた");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 3, 3, 450, 0, 0, "2022/03/03 19:00:00", 3, 1, 0, "2030/12/31 15:00:00", 731, 0, 121301, 0, 121301, 121301, 121301, 0, 3, 1.9, 0, "クルミ（ステージ）", "くるみ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 7, 7, 450, 0, 0, "2022/03/15 15:00:00", 3, 2, 0, "2030/12/31 15:00:00", 742, 0, 121401, 0, 121401, 121401, 121401, 0, 15, 2.27, 0, "ミサキ（ステージ）", "みさき");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 6, 6, 450, 0, 0, "2024/04/12 12:00:00", 3, 1, 0, "2024/04/15 14:59:59", 590, 0, 121501, 0, 121501, 121501, 121501, 1, 12, 2.0, 0, "アユミ（怪盗）", "あゆみ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 3, 3, 450, 0, 0, "2022/04/15 15:00:00", 3, 1, 0, "2030/12/31 15:00:00", 292, 0, 121601, 0, 121601, 121601, 121601, 0, 17, 1.425, 0, "イノリ（怪盗）", "いのり");
