INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 5, 5, 450, 0, 0, "2022/05/15 15:00:00", 3, 2, 0, "2030/12/31 15:00:00", 293, 0, 121901, 0, 121901, 121901, 121901, 0, 12, 2.125, 0, "アンナ（パイレーツ）", "あんな");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 3, 3, 450, 0, 0, "2022/05/03 19:00:00", 3, 1, 0, "2030/12/31 15:00:00", 380, 0, 122001, 0, 122001, 122001, 122001, 0, 14, 1.425, 0, "シノブ（パイレーツ）", "しのぶ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 35, 35, 450, 0, 0, "2024/04/18 15:00:00", 1, 1, 0, "2030/12/31 15:00:00", 731, 0, 122101, 0, 122101, 122101, 122101, 1, 9, 1.97, 0, "アオイ（キャンプ）", "あおい");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 4, 4, 450, 0, 0, "2022/05/31 12:00:00", 3, 1, 0, "2030/12/31 15:00:00", 419, 0, 122201, 0, 122201, 122201, 122201, 0, 8, 1.84, 0, "ユカリ（キャンプ）", "ゆかり");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 43, 43, 450, 0, 0, "2022/06/15 15:00:00", 3, 2, 0, "2030/12/31 15:00:00", 564, 0, 122301, 0, 122301, 122301, 122301, 0, 0, 1.425, 0, "ヴァンピィ", "うぁんぴぃ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 1, 1, 450, 0, 0, "2024/06/17 15:00:00", 1, 1, 0, "2030/12/31 15:00:00", 264, 0, 122401, 0, 122401, 122401, 122401, 1, 8, 2.42, 0, "ヒヨリ（サマー）", "ひより");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 4, 4, 450, 0, 0, "2024/08/26 19:00:00", 3, 1, 0, "2024/08/31 11:59:59", 250, 0, 122501, 0, 122501, 122501, 122501, 1, 0, 1.965, 0, "レイ（サマー）", "れい");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 7, 7, 450, 0, 0, "2022/07/15 15:00:00", 3, 2, 0, "2030/12/31 15:00:00", 554, 0, 122601, 0, 122601, 122601, 122601, 0, 0, 2.27, 0, "ユイ（サマー）", "ゆい");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 7, 7, 450, 0, 0, "2022/08/15 15:00:00", 3, 2, 0, "2030/12/31 15:00:00", 812, 0, 122701, 0, 122701, 122701, 122701, 0, 0, 1.92, 0, "キョウカ（サマー）", "きょうか");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 1, 1, 450, 0, 0, "2024/07/16 15:00:00", 1, 1, 0, "2030/12/31 15:00:00", 237, 0, 122801, 0, 122801, 122801, 122801, 1, 0, 2.295, 0, "ミソギ（サマー）", "みそぎ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 5, 5, 450, 0, 0, "2024/08/26 19:00:00", 3, 1, 0, "2024/08/31 11:59:59", 361, 0, 122901, 0, 122901, 122901, 122901, 1, 0, 2.25, 0, "ミミ（サマー）", "みみ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 44, 44, 450, 0, 0, "2024/12/31 12:00:00", 3, 2, 0, "2025/01/03 18:59:59", 746, 0, 123001, 0, 123001, 123001, 123001, 1, 0, 2.27, 0, "アメス", "あめす");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 7, 7, 450, 0, 0, "2022/09/03 19:00:00", 3, 2, 0, "2030/12/31 15:00:00", 793, 0, 123101, 0, 123101, 123101, 123101, 0, 0, 1.795, 0, "マホ（エクスプローラー）", "まほ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 3, 3, 450, 0, 0, "2022/09/15 15:00:00", 3, 1, 0, "2030/12/31 15:00:00", 256, 0, 123201, 0, 123201, 123201, 123201, 0, 0, 1.425, 0, "アヤネ（エクスプローラー）", "あやね");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 0, 1, 450, 0, 0, "2024/09/25 12:00:00", 3, 1, 0, "2024/09/30 11:59:59", 350, 0, 123301, 0, 123301, 123301, 123301, 1, 0, 1.62, 0, "ネア", "ねあ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("", 5, 5, 0, 0, 0, "2015/04/01 15:00:00", 3, 0, 0, "2030/12/31 15:00:00", 0, 0, 123401, 0, 0, 123401, 0, 0, 0, 0.0, 0, "ジュン（キャンプ）", "じゅん");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 6, 6, 450, 0, 0, "2024/09/17 15:00:00", 1, 1, 0, "2030/12/31 15:00:00", 583, 0, 123501, 0, 123501, 123501, 123501, 1, 0, 2.34, 0, "リン（ハロウィン）", "りん");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 4, 4, 450, 0, 0, "2024/10/24 12:00:00", 3, 1, 0, "2024/10/28 11:59:59", 262, 0, 123601, 0, 123601, 123601, 123601, 1, 0, 1.965, 0, "トモ（ハロウィン）", "とも");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 21, 7, 450, 0, 0, "2022/10/15 15:00:00", 3, 2, 0, "2030/12/31 15:00:00", 741, 0, 123701, 0, 123701, 123701, 123701, 0, 0, 2.07, 0, "ナナカ（ハロウィン）", "ななか");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 1, 1, 450, 0, 0, "2024/11/26 12:00:00", 3, 1, 0, "2024/11/30 11:59:59", 238, 0, 123801, 0, 123801, 123801, 123801, 1, 0, 2.295, 0, "クリスティーナ（ワイルド）", "くりすてぃーな");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 2, 2, 450, 0, 0, "2022/11/15 15:00:00", 3, 1, 0, "2030/12/31 15:00:00", 183, 0, 123901, 0, 123901, 123901, 123901, 0, 0, 2.125, 0, "マツリ（ワイルド）", "まつり");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 7, 7, 450, 0, 0, "2024/12/22 12:00:00", 3, 2, 0, "2024/12/31 11:59:59", 438, 0, 124001, 0, 124001, 124001, 124001, 1, 0, 2.07, 0, "アカリ（クリスマス）", "あかり");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 6, 6, 450, 0, 0, "2024/11/16 15:00:00", 1, 2, 0, "2030/12/31 15:00:00", 433, 0, 124101, 0, 124101, 124101, 124101, 1, 0, 1.965, 0, "ヨリ（クリスマス）", "より");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 5, 5, 450, 0, 0, "2022/12/23 12:00:00", 3, 1, 0, "2030/12/31 15:00:00", 144, 0, 124201, 0, 124201, 124201, 124201, 0, 0, 2.07, 0, "ジュン（クリスマス）", "じゅん");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("", 0, 0, 0, 0, 0, "2015/04/01 15:00:00", 3, 0, 181001, "2030/12/31 15:00:00", 577, 1, 124301, 0, 0, 124301, 0, 1, 0, 0.0, 0, "アン（アン＆グレア）", "あん");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("", 0, 0, 0, 0, 0, "2015/04/01 15:00:00", 3, 0, 181001, "2030/12/31 15:00:00", 577, 1, 124401, 0, 0, 124401, 0, 1, 0, 0.0, 0, "グレア（アン＆グレア）", "ぐれあ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 21, 7, 450, 0, 0, "2025/01/15 15:00:00", 3, 2, 0, "2025/01/20 11:59:59", 707, 0, 124501, 0, 124501, 124501, 124501, 1, 0, 2.07, 0, "ホマレ（ニューイヤー）", "ほまれ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 21, 7, 450, 0, 0, "2025/01/15 15:00:00", 3, 2, 0, "2025/01/20 11:59:59", 698, 0, 124601, 0, 124601, 124601, 124601, 1, 0, 2.44, 0, "ミサト（ニューイヤー）", "みさと");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 46, 7, 450, 0, 0, "2024/12/16 15:00:00", 1, 1, 0, "2030/12/31 15:00:00", 590, 0, 124701, 0, 124701, 124701, 124701, 1, 0, 2.24, 0, "ミツキ（ニューイヤー）", "みつき");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 0, 4, 450, 0, 0, "2024/02/12 12:00:00", 3, 1, 0, "2024/02/14 23:59:59", 423, 0, 124801, 0, 124801, 124801, 124801, 1, 0, 2.14, 0, "ノゾミ（リベレイター）", "のぞみ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 0, 1, 450, 0, 0, "2025/01/16 15:00:00", 1, 1, 0, "2030/12/31 15:00:00", 170, 0, 124901, 0, 124901, 124901, 124901, 1, 0, 1.965, 0, "カヤ（リベレイター）", "かや");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 0, 5, 450, 0, 0, "2024/02/12 12:00:00", 3, 1, 0, "2024/02/14 23:59:59", 221, 0, 125001, 0, 125001, 125001, 125001, 1, 0, 1.965, 0, "ムイミ（リベレイター）", "むいみ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 47, 8, 450, 0, 0, "2023/03/03 19:00:00", 3, 1, 0, "2030/12/31 15:00:00", 825, 0, 125101, 0, 125101, 125101, 125101, 0, 0, 2.24, 0, "タマキ（カフェ）", "たまき");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 4, 4, 450, 0, 0, "2023/03/10 12:00:00", 3, 1, 0, "2030/12/31 15:00:00", 463, 0, 125201, 0, 125201, 125201, 125201, 0, 0, 1.965, 0, "モニカ（カフェ）", "もにか");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 6, 6, 450, 0, 0, "2024/04/12 12:00:00", 3, 1, 0, "2024/04/15 14:59:59", 752, 0, 125301, 0, 125301, 125301, 125301, 1, 0, 2.07, 0, "コッコロ（レンジャー）", "こっころ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 8, 8, 450, 0, 0, "2023/04/10 12:00:00", 3, 1, 0, "2030/12/31 15:00:00", 710, 0, 125401, 0, 125401, 125401, 125401, 0, 0, 2.09, 0, "シオリ（レンジャー）", "しおり");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 50, 7, 450, 0, 0, "2024/05/10 12:00:00", 3, 2, 0, "2024/05/15 14:59:59", 443, 0, 125501, 0, 125501, 125501, 125501, 1, 0, 1.92, 0, "ジータ（ウォーロック）", "じーた");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 0, 51, 450, 0, 0, "2024/05/10 12:00:00", 3, 1, 0, "2024/05/15 14:59:59", 267, 0, 125601, 0, 125601, 125601, 125601, 1, 0, 2.09, 0, "ビカラ", "びから");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 9, 7, 450, 0, 0, "2023/04/30 12:00:00", 1, 2, 0, "2030/12/31 15:00:00", 579, 1, 125701, 0, 125701, 125701, 125701, 1, 0, 2.24, 0, "カリン（アルケミスト）", "かりん");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 0, 3, 450, 0, 0, "2023/04/17 12:00:00", 3, 1, 0, "2030/12/31 15:00:00", 464, 0, 125801, 0, 125801, 125801, 125801, 0, 0, 2.09, 0, "リリ（フォールン）", "りり");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("", 1, 1, 0, 0, 0, "2015/04/01 15:00:00", 3, 0, 0, "2030/12/31 15:00:00", 0, 0, 125901, 0, 0, 125901, 0, 1, 0, 0.0, 0, "カヤ（リベレイター）", "かや");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 0, 450, 0, 0, "2023/10/31 12:00:00", 3, 1, 0, "2030/12/31 15:00:00", 406, 0, 126001, 0, 126001, 126001, 126001, 0, 0, 2.09, 0, "クリア（フォールン）", "くりあ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 53, 44, 450, 0, 0, "2023/11/15 15:00:00", 3, 2, 0, "2030/12/31 15:00:00", 480, 0, 126101, 0, 126101, 126101, 126101, 0, 0, 2.09, 0, "プレシア（フォールン）", "ぷれしあ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 3, 3, 450, 0, 0, "2024/06/10 12:00:00", 3, 2, 0, "2024/06/15 14:59:59", 568, 0, 126201, 0, 126201, 126201, 126201, 1, 0, 2.09, 0, "イリヤ（儀装束）", "いりや");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 9, 7, 450, 0, 0, "2023/06/15 15:00:00", 3, 2, 0, "2030/12/31 15:00:00", 456, 0, 126301, 0, 126301, 126301, 126301, 0, 0, 2.07, 0, "ユキ（儀装束）", "ゆき");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 1, 1, 450, 0, 0, "2024/12/31 12:00:00", 3, 1, 0, "2025/01/03 18:59:59", 373, 0, 126401, 0, 126401, 126401, 126401, 1, 0, 2.09, 0, "クローチェ", "くろーちぇ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 0, 7, 450, 0, 0, "2024/12/31 12:00:00", 3, 2, 0, "2025/01/03 18:59:59", 740, 0, 126501, 0, 126501, 126501, 126501, 1, 0, 1.965, 0, "ライラエル", "らいらえる");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 7, 7, 450, 0, 0, "2024/07/11 12:00:00", 3, 2, 0, "2024/07/15 14:59:59", 650, 0, 126601, 0, 126601, 126601, 126601, 1, 0, 2.04, 0, "ネネカ（サマー）", "ねねか");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 5, 5, 450, 0, 0, "2023/06/30 12:00:00", 1, 1, 0, "2030/12/31 15:00:00", 224, 1, 126701, 0, 126701, 126701, 126701, 1, 0, 1.965, 0, "アキノ（サマー）", "あきの");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 5, 5, 450, 0, 0, "2023/07/15 15:00:00", 3, 1, 0, "2030/12/31 15:00:00", 159, 0, 126801, 0, 126801, 126801, 126801, 0, 0, 1.97, 0, "ユカリ（サマー）", "ゆかり");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 21, 7, 450, 0, 0, "2024/08/09 12:00:00", 3, 2, 0, "2024/08/12 11:59:59", 682, 0, 126901, 0, 126901, 126901, 126901, 1, 0, 1.965, 0, "ランファ（サマー）", "らんふぁ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 52, 2, 450, 0, 0, "2023/07/31 12:00:00", 1, 1, 0, "2023/08/14 20:59:59", 133, 1, 127001, 0, 127001, 127001, 127001, 1, 0, 1.97, 0, "クウカ（サマー）", "くうか");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 46, 5, 450, 0, 0, "2024/08/09 12:00:00", 3, 1, 0, "2024/08/12 11:59:59", 255, 0, 127101, 0, 127101, 127101, 127101, 1, 0, 2.09, 0, "シノブ（サマー）", "しのぶ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 7, 7, 450, 0, 0, "2024/10/10 12:00:00", 3, 2, 0, "2024/10/13 11:59:59", 804, 0, 127201, 0, 127201, 127201, 127201, 1, 0, 2.09, 0, "キャル（編入生）", "きゃる");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 8, 8, 450, 0, 0, "2023/09/15 15:00:00", 3, 1, 0, "2030/12/31 15:00:00", 750, 0, 127301, 0, 127301, 127301, 127301, 0, 0, 2.09, 0, "スズナ（編入生）", "すずな");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("", 1, 1, 0, 0, 0, "2015/04/01 15:00:00", 3, 0, 0, "2030/12/31 15:00:00", 0, 0, 127401, 0, 0, 127401, 0, 1, 0, 0.0, 0, "ビカラ（コラボ）", "びから");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 4, 4, 450, 0, 0, "2024/11/11 12:00:00", 3, 1, 0, "2024/11/18 11:59:59", 304, 0, 127501, 0, 127501, 127501, 127501, 1, 0, 2.09, 0, "サレン（サラサリア）", "されん");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 4, 4, 450, 0, 0, "2023/10/15 15:00:00", 3, 1, 0, "2030/12/31 15:00:00", 157, 0, 127601, 0, 127601, 127601, 127601, 0, 0, 1.965, 0, "ルカ（サラサリア）", "るか");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 48, 6, 450, 0, 0, "2024/10/10 12:00:00", 3, 2, 0, "2030/12/31 15:00:00", 693, 0, 127701, 0, 127701, 127701, 127701, 0, 0, 1.965, 0, "リンド", "りんど");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 47, 7, 450, 0, 0, "2024/10/18 12:00:00", 3, 2, 0, "2030/12/31 15:00:00", 706, 0, 127801, 0, 127801, 127801, 127801, 0, 0, 1.965, 0, "ヴルム", "うるむ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 5, 5, 450, 0, 0, "2024/12/09 12:00:00", 3, 2, 0, "2024/12/15 14:59:59", 372, 0, 127901, 0, 127901, 127901, 127901, 1, 0, 1.965, 0, "ペコリーヌ（クリスマス）", "ぺこりーぬ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 35, 35, 450, 0, 0, "2023/12/15 15:00:00", 3, 1, 0, "2030/12/31 15:00:00", 723, 0, 128001, 0, 128001, 128001, 128001, 0, 0, 2.09, 0, "クレジッタ（クリスマス）", "くれじった");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("", 0, 0, 0, 0, 0, "2015/04/01 15:00:00", 3, 0, 181101, "2030/12/31 15:00:00", 580, 1, 128101, 0, 0, 128101, 0, 1, 0, 0.0, 0, "シズル（シズル&リノ）", "しずる");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("", 0, 0, 0, 0, 0, "2015/04/01 15:00:00", 3, 0, 181101, "2030/12/31 15:00:00", 580, 1, 128201, 0, 0, 128201, 0, 1, 0, 0.0, 0, "リノ（シズル&リノ）", "りの");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 38, 3, 450, 0, 0, "2023/12/31 12:00:00", 1, 1, 0, "2030/12/31 15:00:00", 191, 1, 128301, 0, 128301, 128301, 128301, 1, 0, 2.09, 0, "イノリ（ニューイヤー）", "いのり");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 21, 7, 450, 0, 0, "2025/01/09 12:00:00", 3, 2, 0, "2025/01/15 14:59:59", 801, 0, 128401, 0, 128401, 128401, 128401, 1, 0, 2.09, 0, "ハツネ（ニューイヤー）", "はつね");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 21, 7, 450, 0, 0, "2025/01/09 12:00:00", 3, 2, 0, "2025/01/15 14:59:59", 739, 0, 128501, 0, 128501, 128501, 128501, 1, 0, 2.09, 0, "カスミ（ニューイヤー）", "かすみ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("", 1, 1, 0, 0, 0, "2015/04/01 15:00:00", 3, 0, 0, "2030/12/31 15:00:00", 0, 0, 128601, 0, 0, 128601, 0, 1, 0, 0.0, 0, "リリ（フォールン）", "りり");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 0, 1, 450, 0, 0, "2024/08/12 12:00:00", 3, 1, 0, "2024/08/15 14:59:59", 226, 0, 128701, 0, 128701, 128701, 128701, 1, 0, 2.09, 0, "ヒヨリ（アストラル）", "ひより");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 0, 4, 450, 0, 0, "2024/01/31 12:00:00", 1, 1, 0, "2030/12/31 15:00:00", 194, 1, 128801, 0, 128801, 128801, 128801, 1, 0, 1.965, 0, "レイ（アストラル）", "れい");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 0, 7, 450, 0, 0, "2024/08/12 12:00:00", 3, 2, 0, "2024/08/15 14:59:59", 772, 0, 128901, 0, 128901, 128901, 128901, 1, 0, 2.09, 0, "ユイ（アストラル）", "ゆい");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 0, 7, 450, 0, 0, "2024/12/31 12:00:00", 3, 2, 0, "2025/01/03 18:59:59", 800, 0, 129001, 0, 129001, 129001, 129001, 1, 0, 2.09, 0, "エリス", "えりす");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 7, 7, 450, 0, 0, "2024/09/25 12:00:00", 3, 1, 0, "2024/09/30 11:59:59", 708, 0, 129301, 0, 129301, 129301, 129301, 1, 0, 2.09, 0, "ユニ（ウィンター）", "ゆに");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 2, 2, 450, 0, 0, "2024/03/18 12:00:00", 3, 1, 0, "2030/12/31 15:00:00", 188, 0, 129401, 0, 129401, 129401, 129401, 0, 0, 2.09, 0, "クロエ（ウィンター）", "くろえ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 1, 1, 450, 0, 0, "2024/12/15 15:00:00", 3, 1, 0, "2024/12/22 11:59:59", 247, 0, 129501, 0, 129501, 129501, 129501, 1, 0, 2.09, 0, "チエル（ウィンター）", "ちえる");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, 0, 450, 0, 0, "2024/12/31 12:00:00", 3, 1, 0, "2025/01/03 18:59:59", 550, 0, 129601, 0, 129601, 129601, 129601, 1, 0, 2.09, 0, "アネモネ", "あねもね");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, 0, 450, 0, 0, "2024/12/31 12:00:00", 3, 1, 0, "2025/01/03 18:59:59", 540, 0, 129701, 0, 129701, 129701, 129701, 1, 0, 2.09, 0, "ネフィ＝ネラ", "ねふぃーねら");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 5, 5, 450, 0, 0, "2024/10/13 12:00:00", 3, 1, 0, "2024/10/18 11:59:59", 269, 0, 129801, 0, 129801, 129801, 129801, 1, 0, 2.09, 0, "マコト（コマンダー）", "まこと");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 48, 6, 450, 0, 0, "2024/04/15 15:00:00", 3, 1, 0, "2030/12/31 15:00:00", 294, 0, 129901, 0, 129901, 129901, 129901, 0, 0, 1.84, 0, "エリコ（コマンダー）", "えりこ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 0, 4, 450, 0, 0, "2024/11/11 12:00:00", 3, 1, 0, "2024/11/18 11:59:59", 150, 0, 130001, 0, 130001, 130001, 130001, 1, 0, 2.09, 0, "ヤマト", "やまと");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 9, 7, 450, 0, 0, "2024/11/18 12:00:00", 3, 1, 0, "2024/11/26 11:59:59", 535, 0, 130101, 0, 130101, 130101, 130101, 1, 0, 2.09, 0, "ワカナ", "わかな");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 0, 5, 450, 0, 0, "2024/10/31 12:00:00", 3, 1, 0, "2024/11/11 11:59:59", 371, 0, 130201, 0, 130201, 130201, 130201, 1, 0, 1.84, 0, "フブキ", "ふぶき");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("", 1, 4, 0, 0, 0, "2015/04/01 15:00:00", 3, 0, 0, "2030/12/31 15:00:00", 0, 0, 130601, 0, 0, 130601, 0, 1, 0, 0.0, 0, "レイ（アストラル）", "れい");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 7, 7, 450, 0, 0, "2024/11/11 12:00:00", 3, 2, 0, "2024/11/18 11:59:59", 563, 0, 130701, 0, 130701, 130701, 130701, 1, 0, 1.92, 0, "キョウカ（スプリング）", "きょうか");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 7, 7, 450, 0, 0, "2024/05/15 15:00:00", 3, 2, 0, "2030/12/31 15:00:00", 558, 0, 130801, 0, 130801, 130801, 130801, 0, 0, 1.84, 0, "スズメ（スプリング）", "すずめ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 7, 7, 450, 0, 0, "2024/06/15 15:00:00", 3, 2, 0, "2030/12/31 15:00:00", 440, 0, 130901, 0, 130901, 130901, 130901, 0, 0, 2.09, 0, "クルル", "くるる");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 7, 7, 450, 0, 0, "2024/12/09 12:00:00", 3, 2, 0, "2024/12/15 14:59:59", 702, 0, 131001, 0, 131001, 131001, 131001, 1, 0, 1.84, 0, "マホ（ドリームパーク）", "まほ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 52, 2, 450, 0, 0, "2024/06/30 12:00:00", 3, 1, 0, "2030/12/31 15:00:00", 165, 0, 131101, 0, 131101, 131101, 131101, 0, 0, 2.09, 0, "ネア（サマー）", "ねあ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 35, 35, 450, 0, 0, "2025/01/09 12:00:00", 3, 2, 0, "2025/01/15 14:59:59", 753, 0, 131201, 0, 131201, 131201, 131201, 1, 0, 2.09, 0, "ミソラ（サマー）", "みそら");
