INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 4, 4, 450, 0, 0, "2025/01/09 12:00:00", 3, 1, 0, "2025/01/15 14:59:59", 399, 0, 131601, 0, 131601, 131601, 131601, 1, 0, 1.92, 0, "リリ（サマー）", "りり");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 53, 44, 450, 0, 0, "2024/07/31 12:00:00", 3, 2, 0, "2024/08/12 11:59:59", 743, 0, 131701, 0, 131701, 131701, 131701, 1, 0, 1.92, 0, "アメス（サマー）", "あめす");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 21, 7, 450, 0, 0, "2024/08/15 15:00:00", 3, 2, 0, "2030/12/31 15:00:00", 709, 0, 131801, 0, 131801, 131801, 131801, 0, 0, 2.09, 0, "ホマレ（サマー）", "ほまれ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 23, 7, 450, 0, 0, "2024/08/31 12:00:00", 1, 2, 0, "2030/12/31 15:00:00", 725, 1, 131901, 0, 131901, 131901, 131901, 1, 0, 2.09, 0, "エミリア（サマー）", "えみりあ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 21, 7, 450, 0, 0, "2024/09/13 12:00:00", 3, 2, 0, "2024/09/25 11:59:59", 775, 0, 132001, 0, 132001, 132001, 132001, 1, 0, 2.09, 0, "エキドナ（サマー）", "えきどな");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 24, 13, 450, 0, 0, "2024/08/31 12:00:00", 3, 1, 0, "2024/09/13 11:59:59", 146, 0, 132101, 0, 132101, 132101, 132101, 1, 0, 2.09, 0, "レム（サマー）", "れむ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 7, 7, 450, 0, 0, "2024/09/30 12:00:00", 3, 2, 0, "2024/10/10 11:59:59", 721, 0, 132201, 0, 132201, 132201, 132201, 1, 0, 1.84, 0, "ノゾミ（アルケミスト）", "のぞみ");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 0, 7, 450, 0, 0, "2024/11/30 12:00:00", 3, 2, 0, "2024/12/09 11:59:59", 750, 0, 132801, 0, 132801, 132801, 132801, 1, 0, 2.09, 0, "ライラエル（クリスマス）", "らいらえる");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 46, 5, 450, 0, 0, "2024/12/09 12:00:00", 3, 2, 0, "2030/12/31 15:00:00", 748, 0, 132901, 0, 132901, 132901, 132901, 0, 0, 2.09, 0, "イオ（クリスマス）", "いお");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 0, 0, 450, 0, 0, "2024/12/31 12:00:00", 3, 1, 0, "2025/01/03 18:59:59", 234, 0, 133001, 0, 133001, 133001, 133001, 1, 0, 2.09, 0, "グレイス", "ぐれいす");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 22, 4, 450, 0, 0, "2024/12/31 12:00:00", 1, 1, 0, "2030/12/31 15:00:00", 296, 1, 133201, 0, 133201, 133201, 133201, 1, 0, 2.09, 0, "モニカ（ニューイヤー）", "もにか");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 22, 4, 450, 0, 0, "2025/01/03 19:00:00", 3, 2, 0, "2025/01/15 14:59:59", 718, 0, 133501, 0, 133501, 133501, 133501, 1, 0, 2.09, 0, "サレン（ニューイヤー）", "されん");
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("", 1, 5, 0, 0, 0, "2015/04/01 15:00:00", 3, 0, 0, "2030/12/31 15:00:00", 0, 0, 134101, 0, 0, 134101, 0, 1, 0, 0.0, 0, "フブキ", "ふぶき");
