INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES ("【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 6, 6, 450, 0, 0, "2015/04/01 15:00:00", 1, 1, 0, "2030/12/31 15:00:00", 850, 0, 191301, 0, 191301, 191301, 191301, 1, 0, 2.22, 0, "カズマサ", "かずまさ");
